// @ts-nocheck
import React from "react";
import { Card, Button } from "intelli-ui-components-library";
import { AddIcon, DeleteIcon } from "../../assets/icons";

const CreateParam = () => {
  const paths = useAppSelector((state) => state.main.paths);
  const dispatch = useAppDispatch();
  const defaultParamObj = {
    name: "newParam",
    in: "query",
    required: false,
    schema: {
      type: "string",
    },
  };
  return (
    <>
      <Card
        round="round"
        style={{
          width: "100%",
        }}
      >
        <Card.CardHeader
          title="There are no parameters defined for this operation."
          divider="dark"
        />
        <Card.CardAction>
          <div>
            <Button
              //   children="Create Parameter"
              size="md"
              variant="contained"
              round="round"
              color="primary"
              onClick={() => {
                dispatch(
                  updatePath({
                    pathName,
                    methodName,
                    methodKey: "parameters",
                    data: {
                      ...paths[pathName][methodName].parameters,
                    },
                  })
                );
              }}
              className="mb-2"
              icon={<AddIcon />}
            >
              <span>
                <AddIcon />
              </span>
              Create Parameter
            </Button>
          </div>
        </Card.CardAction>
      </Card>
    </>
  );
};

export default CreateParam;
